import React from 'react';

import './custom-button.styles.scss';

const CustomButton = ({children, isCheckIn, isCheckOut, ...otherProps}) => {
    return (
        <div>
            <button className={`${isCheckIn ? 'check-in' : isCheckOut ? 'check-out' : 'submit' }  custom-button`} {...otherProps}>
                {children}
            </button>
        </div>
    )
}

export default CustomButton;
